import './App.css';
import Customer from './components/Customer'

const customer1 = {
  'name': 'Kelly Park',
  'birthday': '920418',
  'gender': 'Female',
  'job': 'Student'
}

function App() {
  return (
    <Customer 
    name={customer1.name}
    birthday={customer1.birthday}
    gender={customer1.gender}
    job={customer1.job}
    />
  );
}

export default App;
